import React, {useState, useMemo, useEffect} from "react";
import About from "./pages/About";
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/about">
          <About/>
        </Route>
      </Routes>
    </Router>
  )
}

export default App;
